import React, { Component } from 'react';

//Inclu les fichiers communs
import Header from '../Common/Header';
import Footer from '../Common/Footer';

export default class Home extends Component {
  componentDidMount(){
    document.title = "Home"
  }

  render() {
    return (
        <div>
          {/* HEADER */}
          <Header title="Home"></Header>

          <p>Hola</p>

          {/* FOOTER */}
          <Footer></Footer>
        </div>
    );
  }
}
